import { Fragment } from 'react'
import { Disclosure } from '@headlessui/react'
import { Bars3Icon, XMarkIcon } from '@heroicons/react/24/outline'
import Signature from '../Assets/Signature White.png'
import React, { useState } from 'react';
import {Link} from "react-router-dom";

const navigation = [
  { name: 'Home', href: '/Home', current: false },
  { name: 'Parcours', href: '/Parcours', current: false },
  { name: 'Technologies', href: '/Technologies', current: false },
  { name: 'Projets', href: '/Projets', current: false },
  { name: 'Hackathons', href: '/Hackathons', current: false },
  { name: 'Expériences', href: '/Expériences', current: false },
]

function Example() {
  const [navItems, setNavItems] = useState(navigation);

  const handleItemClick = (index) => {
    const updatedNavItems = navItems.map((item, i) => ({
      ...item,
      current: i === index,
    }));
    setNavItems(updatedNavItems);
  };

  return (
    <Disclosure as="nav" className="bg-gray-800">
      {({ open }) => (
        <div className="mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
          <div className="relative flex items-center justify-center h-16">
            <div className="flex-1 flex items-center justify-center sm:items-stretch sm:justify-start">
              <div className="flex-shrink-0">
                <img className="h-8 w-auto" src={Logo} alt="Logo" />
              </div>
            </div>
          </div>
        </div>
      )}
    </Disclosure>
  )
      }

function classNames(...classes) {
  return classes.filter(Boolean).join(' ')
}

export default Example;
